(ОКУД 0420171/0420267/0420109) В отчете в обязательном порядке должны быть представлены сведения по следующим показателям:
для привлеченного лица, являющегося кредитной организацией (ее филиалом) - "Полное наименование", "Регистрационный номер кредитной организации (порядковый номер ее филиала)", "Номер договора", "Дата заключения договора" и "Код поручения";
для привлеченного лица, не являющегося кредитной организацией (ее филиалом) - "Полное наименование", "Основной государственный регистрационный номер (ОГРН)", "Идентификационный номер налогоплательщика (ИНН)", "Код причины постановки на учет (КПП)", "Номер договора", "Дата заключения договора" и "Код поручения".

(ОКУД 0420510/0420419/0420717) В отчете в обязательном порядке должны быть представлены сведения по следующим показателям: 
для привлеченного лица, являющегося кредитной организацией (ее филиалом) - "Полное наименование", "Код страны", "Регистрационный номер кредитной организации (порядковый номер ее филиала)", "Код поручения", "Номер договора", "Дата заключения договора"; 
для привлеченного лица-резидента, не являющегося кредитной организацией (ее филиалом) - "Полное наименование", "Код страны", "Основной государственный регистрационный номер (ОГРН)", "Идентификационный номер налогоплательщика (ИНН)", "Код причины постановки на учет (КПП)", "Код поручения", "Номер договора", "Дата заключения договора"; 
для привлеченного лица, являющегося иностранным банком - "Полное наименование", "Код страны", "Код СВИФТ", "Код поручения", "Номер договора", "Дата заключения договора", в случае, если иностранный банк не является участником системы СВИФТ, дополнительно - "Идентификационный номер налогоплательщика – иностранной организации (или его аналог) в стране регистрации (Tax Identification Number, TIN)" (при этом по показателю "Код СВИФТ" указывается "000" (три нуля)); 
для привлеченного лица, являющегося иной иностранной финансовой организацией - "Полное наименование", "Код страны", "Идентификационный номер налогоплательщика – иностранной организации (или его аналог) в стране регистрации (Tax Identification Number, TIN)", "Код поручения", "Номер договора", "Дата заключения договора".
